import { Chessboard, onPieceMove } from "react-chessboard";
import "../Styles/Chessboard.css";
import { useState } from "react";

export default function Chessboard2() {;
  function handlePieceMove(sourceSquare, targetSquare) {
    console.log(`Piece moved from ${sourceSquare} to ${targetSquare}`);
  }
  return (
    <div className="Chessboard">
      <Chessboard id="Basicboard" onPieceMove={handlePieceMove}/>
    </div>
  );
}
